import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

function About() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow px-6 py-12 bg-cream text-coffeeBrown">
        <h1 className="text-4xl font-semibold mb-6">About Us</h1>
        <p>
          TheThreeBRose is dedicated to serving the finest homemade dishes and the richest coffee to your doorstep.
          Our passion is to bring you quality and comfort in every cup and bite.
        </p>
      </main>
      <Footer />
    </div>
  );
}

export default About;
